import cardImg from '../images/maincard.png';
import AboutImg from "../images/About.png";
import Navbar from './Navbar';
export default class MainCard extends Component {
    render() {
        return (
            <div class="card pmd-card bg-dark text-white text-center overlay-card">
                {/* <img src={cardImg} class="pmd-card-media" /> */}
                <div class="main-card" style={{border:'5px solid red',height:'80vh'}}>
             <img src={cardImg} class="pmd-card-media" height="" width='100%'/>
                </div>
                <div class="card-img-overlay mt-0 pt-0">
                        <Navbar />
                </div>
            </div>
                
        )
    }
}
